import React, { Component } from 'react';
import {Apps ,Container,MainTitle,BtnToggle,BtnChange} from './style.js';


import StatesPrice from './StatesPrice';

class App extends Component {
	state = {
		textflag: false
	};
	ToggleButton() {
		this.setState({ textflag: !this.state.textflag });
	}
	render() {
		let statePrices;
		if(this.state.textflag === false){
			statePrices =	<span>Hide </span>
		}else{
			statePrices = 	<span>Show</span>
		}
		return (
			<Apps>
				<Container>
					<MainTitle>Our Pricing</MainTitle>
					<BtnToggle>
						<span>Annually</span>
						<BtnChange onClick={() => this.ToggleButton()}  />

						
						{statePrice}
					</BtnToggle>
					
					<StatesPrice />
				</Container>
			</Apps>
		);
	}
}

export default App;
